import React, { useState, useEffect } from 'react';
import {
  Link, useNavigate
} from 'react-router-dom';
import Grid from '@material-ui/core/Grid';
import LeftBar from './../../component/leftbar/leftbar'
/* 第三方组件 */
import { makeStyles } from '@material-ui/core/styles';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button
} from '@material-ui/core';
import './Programme.css'
function Programme (props) {
  const [msg, setmsg] = useState('');/* 提示的文案信息 */
  useEffect(() => {
  }, []);

  // 模拟的学生模块列表数据
  const studentModules = [
    { id: 1, module: 'Mathematics', StartTime: 3, EndTime: 'A' },
    { id: 2, module: 'Physics', StartTime: 4, EndTime: 'B' },
    { id: 3, module: 'History', StartTime: 3, EndTime: 'C' },
    { id: 4, module: 'Computer Science', StartTime: 5, EndTime: 'A' }, { id: 1, module: 'Mathematics', credits: 3, grade: 'A' },
    { id: 2, module: 'Physics', StartTime: 4, EndTime: 'B' },
    { id: 3, module: 'History', StartTime: 3, EndTime: 'C' },
    { id: 4, module: 'Computer Science', StartTime: 5, EndTime: 'A' }, { id: 1, module: 'Mathematics', credits: 3, grade: 'A' },
    { id: 2, module: 'Physics', StartTime: 4, EndTime: 'B' },
    { id: 3, module: 'History', StartTime: 3, EndTime: 'C' },
    { id: 4, module: 'Computer Science', StartTime: 5, grade: 'A' }, { id: 1, module: 'Mathematics', credits: 3, grade: 'A' },
    { id: 2, module: 'Physics', StartTime: 4, grade: 'B' },
    { id: 3, module: 'History', StartTime: 3, grade: 'C' },
    { id: 4, module: 'Computer Science', StartTime: 5, grade: 'A' },
  ];
  const navigate = useNavigate();
  return (
    <div className='container' id='Programme'>
      <div className='leftbox'>
        <LeftBar tabNav="Programme" />
      </div>
      <div className='maincenter'>
        <div className='topline'>
          <div className='topMain'>
            <h2 className='gFont'>Programme Name</h2>
            <p>description:Programme is a comprehensive software solution designed to streamline and optimize various aspects of project management. It offers tools for planning, scheduling, budgeting, resource allocation, and collaboration, allowing teams to work efficiently and effectively towards their project goals. Programme also provides real-time insights and reporting capabilities to track progress and make informed decisions. With its user-friendly interface and customizable features, Programme is a valuable asset for organizations looking to improve project outcomes and enhance team productivity.</p>
          </div>
        </div>
        <div className='mainList'>
          <h2 className='gFont'>Module List</h2>
          <TableContainer component={Paper} className='tablebox'>
            <Table aria-label="simple table">
              <TableHead>
                <TableRow>
                  <TableCell>Module</TableCell>
                  <TableCell align="right">Credits</TableCell>
                  <TableCell align="right">Grade</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {studentModules.map((module, i) => (
                  <TableRow key={i}>
                    <TableCell component="th" scope="row">
                      {module.module}
                    </TableCell>
                    <TableCell align="center">{module.credits}</TableCell>
                    <TableCell align="center">{module.grade}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>

        </div>

        <div className='fn-clear tr btnline'>
          <Button size="small" onClick={() => {
            navigate('/Modules')
          }} variant="contained" color="secondary">See My Modules</Button>
          &nbsp;<Button size="small" onClick={() => {
            navigate('/MyPrograme')
          }}>Programme History</Button>
        </div>
      </div>
      {/* <Grid container spacing={3}>
        <Grid item xs={4}>

        </Grid>
        <Grid item xs={8}>

        </Grid>
      </Grid> */}
      {msg !== '' ? <Toast msg={msg} /> : ''}
    </div>
  );
}
export default Programme;
